fields.label:
F. – item 7: a trust where a trustee of the Investor is: (a) a bank as defined in Section 3(a)(2) of the Securities Act, a savings and loan 
association, or other institution as defined in Section 3(a)(5)(A) of the Securities Act; (b) acting in a fiduciary capacity; 
and (c) directing the investment in the Fund.

